import './index.css';
import App from './App';
import {BrowserRouter } from 'react-router-dom'
import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
  <BrowserRouter>
  <Router>
    <App />
    </Router>
  </BrowserRouter>,
  document.getElementById('root')
);

